public class ApplicationFactory(string resourceName = null, Action<Humidifier.KinesisAnalyticsV2.Application> factoryAction = null) : ResourceFactory<Humidifier.KinesisAnalyticsV2.Application>(resourceName)
{

    internal InnerApplicationRunConfigurationFactory RunConfigurationFactory { get; set; }

    internal InnerApplicationApplicationMaintenanceConfigurationFactory ApplicationMaintenanceConfigurationFactory { get; set; }

    internal InnerApplicationApplicationConfigurationFactory ApplicationConfigurationFactory { get; set; }

    protected override Humidifier.KinesisAnalyticsV2.Application Create()
    {
        var applicationResult = CreateApplication();
        factoryAction?.Invoke(applicationResult);

        return applicationResult;
    }

    private Humidifier.KinesisAnalyticsV2.Application CreateApplication()
    {
        var applicationResult = new Humidifier.KinesisAnalyticsV2.Application
        {
            GivenName = InputResourceName,
        };

        return applicationResult;
    }
    public override void CreateChildren(Humidifier.KinesisAnalyticsV2.Application result)
    {
        base.CreateChildren(result);

        result.RunConfiguration ??= RunConfigurationFactory?.Build();
        result.ApplicationMaintenanceConfiguration ??= ApplicationMaintenanceConfigurationFactory?.Build();
        result.ApplicationConfiguration ??= ApplicationConfigurationFactory?.Build();
    }

} // End Of Class

